import React, { useState } from 'react'

const Cart = ({ cart, setCart }) => {

  const subTotal = cart.reduce((sum, x) => {
    return sum + x.price
  }, 0)

  return (
    <div>
      <h2>Cart</h2>
      <div>{cart.map((data) => {
        return (
          <>
            <h1>{data.id}</h1>
            <img src={data.thumbnail} alt="" />
          </>
        )
      })}
      <div>subTotal : Rs.{subTotal}</div>
      </div>
    </div>
  )
}

export default Cart
